import React from "react";
import beardedme from "../images/beardedme.jpg";

const Home = () => {
  return (
    <div>
      <title>Home</title>
      {/* <img src={beardedme} alt="It's a picture of me" /> */}
      <p>Creator, Innovator, Hard Worker</p>
      <p>
        Seeking to join a driven team to help in their endeavors and build a
        better future together.
      </p>
      <p>The best way to predict the future is to create it.</p>
      <p>- Peter Drucker</p>
    </div>
  );
};

export default Home;
